import * as topojson from "topojson";
import { MapVisuals } from "../Audioset";

export async function fetchCountries(visuals: MapVisuals) {
  const response = await fetch(visuals.geomap.url);
  const geodata = await response.json();

  const collection = topojson.feature(geodata, geodata.objects.countries) as any;
  console.log(collection.features);
  return collection.features.filter((country: any) => country.id !== "010");
}
